content:
앜ㅋㅋㅋㅋㅋ
아빠 지금 질투하는거 맞죠
왤케 아빠도 귀여워 보이지&gt;&lt;

작가님은 의상 디자이너해도 될듯합니다.
남자인 나도 사고싶네요 저런 옷이라면;
딸내미에게 꼭 선물하게

&#x27;살아있는 생명&quot;
레드 드레이크가ㅏ 희귀하고 강하다고 했는데
따님이 점점 성장하고 계십니다 대마법사님.

나는 &quot;이 넒은 세상이 좋아? 나보다 좋아?&quot;
이걸 기대했는데 ㅋㅋㅋㅋ
산다는 거 듣고 놀랐네 ㅋㅎㅋㅎㅋㅎㅋ

이열 여기도 있네 ~~ &#x27; 어공주랑 비슷해요ㅠ &#x27; 
어공주 표절 사건이나 제대로 파악하고 얘기해라 ㅋㅋㅋㅋㅋ
그리고 어공주랑 비슷한거 그닥 없는 것 같은데ㅋㅋㅋ
컨셉도 누구나 생각할 수 있고 한 번쯤 써봤던 컨셉인 것 같기도 해ㅋㅋ 나도 어공주나 황딸 보기 전까지 딸바보 캐들 있었거든^^);
솔직히 나도 사건 알기 전까지 어공주 좋아했음 근데 표절 사건 보고 조금씩 정 떨어지다가 사건도 모르면서 &#x27; 어공주랑 비슷해요ㅠ &#x27; 하는 팬들 덕분에 어공주 아예 손 뗐다ㅋㅋㅋㅋㅋ
좀 알고 말해 제발^^;

라인업 장기 재연재 서명 갑니다 (1/1000000000000000000000000000)
안하면 나 깰꼬닥 할꺼밍...ㅠ3ㅠ (뿌룩뿌룩)
작가님, 블로그나 그런데다가라도 외전 몇편 연재해주면 안되요오오오오?!?!?! 진짜 이래 끝날줄은 몰랐다구요오오오오;;;

저런 비방, 주술 등 이런거 함부로 따라하면 큰일납니다.
인터넷이나 여기저기 떠도는 그런거 함부로 따라하지마세요;;
어렸을때 뭣도 모르고 친구들이랑 그런거하고 놀다 이상한 경험 몇번하고선 절대안함;;

와아~ 댓글보니까 역사를 무슨 현대인의 21세기의 관점으로 보네
아무리 뭐 같은 나라라도 그렇지. 그렇게 따지면 동시대의 타국들도 마찬가지로 나쁜것들도 많을거 아냐?
그리고 이번화부터 주제가 &#x27;노비&#x27;라서 같은 민족 노예로 부려먹은 나라가 조선 밖에 없다고 하는데 현대의 관점으로 판단하는 일부 독자들에게 묻는다. &#x27;타국을 침략해서 다른 민족을 노예로 삼은게 올바른것일까요?&#x27;

쓰글 유교사상;; 지금도 유교사상에 쩌든놈들보면 짜증납니다.. 
아.. 유교사상아닌 조선사상인가요?
지금은 돈과 권력으로 나눠진 신분제;;
